scriptlet.script:
gateway3_1 = scriptletContext.getLocal("gateway3_1"); 
vName = scriptletContext.getLocal("vName"); 
nicType = (gateway3_1==null||gateway3_1==""|gateway3_1=="null")?"2nic":"3nic";

tshirtsize = scriptletContext.getLocal("tshirtsize"); 
lastChar = tshirtsize.substr(2,3);
osType = (lastChar=="L")?"linux":"windows";

spcname = osType + "_" + nicType;
scriptletContext.put("vcenter.spcname", spcname); 

scriptletContext.put("osType", osType);
